import styled from "styled-components";

function TodoInput() {
  return (
    <Container>
      <Input />
    </Container>
  );
}

const Container = styled.div`
  border-top: 1px solid #bbb;
  padding: 10px;
`;

const Input = styled.input`
  width: 100%;
  outline: none;
  padding: 5px;
`;

export default TodoInput;
